import React from "react";
import './Dog.css'
import { Link} from 'react-router-dom';





const Dog = (dog)=>{

    if (!dog) {
        return <Link to="/"/>
    } 



    return (
      <div className="Dog">

          <img src={dog.src} alt={dog.name} />
          <div className="DogInfo">
             <p>Name: <Link to={`/dogs/${dog.name}`}>{dog.name}</Link> </p>
             <p>{dog.age} years old </p>



        </div>
        <div className="facts">

          {dog.facts.map((fact, i) => (
            <li key={i}>{fact}</li>
          ))}


        </div>
      </div>
    );
}

export default Dog;
